import React, { useState } from 'react'
import { Route, Routes, Link, Navigate } from "react-router-dom";
import { Auths } from './context/auths';
import { LoginName } from './context/loginName';
import Calendar from "./pages/Calendar";
import Login from './pages/Login';
const AppRouter = () => {
    const [isAuth, setIsAuth] = useState(false);
    const [loginData, setLoginData] = useState('');
    return (
        <Auths.Provider value={
            {
                isAuth,
                setIsAuth
            }
        } >
            <LoginName.Provider value={{
                loginData,
                setLoginData
            }
            }>
                <Routes>
                    <Route path='/login' caseSensitive={false} element={<Login />} />
                    <Route path='/calendar' caseSensitive={false} element={<Calendar />} />
                    <Route path='*' caseSensitive={false} element={<Navigate to="/login" replace />} />
                </Routes>

            </LoginName.Provider>
        </Auths.Provider>
    )
}

export default AppRouter
